@BH_Kazimov @Main_kahil This fraudulent “Pasmanda” narrative has not found takers with good reason. We do not practise Caste discrimination.
There are class divides and biradari traditions but that is not a Caste system - by any stretch of the imagination.

“Pasmandagi” does NOT have a caste identity.

@BH_Kazimov @Main_kahil You can call it rhetoric if you like.
The fact is that CASTE is a very specific, codified, defined set of practices, particular to a form of Hinduism.
Matrimonial dynamics in Muslim society are not defined by Caste but by economics and biradari. Neither are Caste, at all.
